function animeteError(arr) {
    arr.addClass('error__animate')
    setTimeout(function() {
        arr.removeClass('error__animate')
    }, 500);
}


function testInput(arr) {
    let type = arr.attr('type')
    switch (type) {
        case 'tel':
            if (arr.val().length == 0 ||
                arr.val() == '+7 (___) ___-__-__' ||
                arr.val().indexOf('_') > 0) {
                arr.addClass('error');
                arr.keyup(function(event) {
                    testInput(arr)
                });
            } else {
                arr.removeClass('error');
            }
            break;
        case 'email':
            if (pattern.test(arr.val())) { arr.removeClass('error') } else { arr.addClass('error') };
            break;
        default:
            let arrVal = $.trim(arr.val());
            if (arrVal === "") {
                arr.addClass('error');
                arr.keyup(function(event) {
                    testInput(arr)
                });
            } else {
                arr.removeClass('error');
            }
            break;
    }
}


// Cache selectors
var lastId,
    topMenu = $(".header__nav"),
    topMenuHeight = topMenu.outerHeight()+30,
    // All list items

    menuItems = topMenu.find("a"),
    // Anchors corresponding to menu items
    scrollItems = menuItems.map(function(){
      var item = $($(this).attr("href"));
      if (item.length) { return item; }
    });
// Bind click handler to menu items
// so we can get a fancy scroll animation
menuItems.click(function(e){
  var href = $(this).attr("href"),
      offsetTop = href === "#" ? 0 : $(href).offset().top-topMenuHeight+1;
  $('html, body').stop().animate({ 
      scrollTop: offsetTop
  }, 300);

  e.preventDefault();
});

// Bind to scroll
$(window).scroll(function(){
   // Get container scroll position
   var fromTop = $(this).scrollTop()+headerHeight+50;
   
   // Get id of current scroll item
   var cur = scrollItems.map(function(){
     if ($(this).offset().top < fromTop)
       return this;
   });
   // Get the id of the current element
   cur = cur[cur.length-1];
   var id = cur && cur.length ? cur[0].id : "";
   
   if (lastId !== id) {
       lastId = id;
       // Set/remove active class
       menuItems
         .parent().removeClass("active")
         .end().filter("[href='#"+id+"']").parent().addClass("active");

   }                   
});



